import Home from "./Home";
import Walk from "./Walk";
import Profile from "./Profile";
import Videos from "./Videos";

class Main extends Component {
  render() {
    return (
      <div className="Main">
        <header className="Main-header">
        Paideia
        </header>
        <div className="content">
        </div>
      </div>
    );
  }
}

export default Main;
